import React from 'react'
import Karavanlar1 from './Components/Karavanlar1';
import Karavanlar2 from './Components/Karavanlar2';
import { karavanlar } from './karavandata';

function App() {
  return (
    <div style={{ width: '100%',gap:5 }}>

      {karavanlar.map((index, karavan) => {
        return <Karavanlar1 key={index} karavanImage={karavan} />
      })}

    </div>
  );
}

export default App;
